import { useNavigate, useParams } from "react-router-dom"

export default function UpdateTask(){
    let nav = useNavigate();
    let {taskId} = useParams();


    return(
        <div>
            <h1>Update a task</h1>
            <h5 onClick={() => {nav("/");}}>Go to home</h5>
        </div>
    )
}
